INSERT INTO `tbl_list_pages` (`id`, `title`, `description`, `status`) VALUES
(1, 'Privacy Policy', 'Privacy Policy\r\n\r\nCSCODETECH built the ZippyGo app as a Free app. This SERVICE is provided by CSCODETECH at no cost and is intended for use as is.\r\n\r\nThis page is used to inform visitors regarding our policies with the collection, use, and disclosure of Personal Information if anyone decided to use our Service.\r\n\r\nIf you choose to use our Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that we collect is used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy.\r\n\r\nThe terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which are accessible at ZippyGo unless otherwise defined in this Privacy Policy.\r\n\r\nInformation Collection and Use\r\n\r\nFor a better experience, while using our Service, we may require you to provide us with certain personally identifiable information. The information that we request will be retained by us and used as described in this privacy policy.\r\n\r\nThe app does use third-party services that may collect information used to identify you.\r\n\r\nLink to the privacy policy of third-party service providers used by the app\r\n\r\nLog Data\r\n\r\nWe want to inform you that whenever you use our Service, in a case of an error in the app we collect data and information (through third-party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (IP) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics.\r\n\r\nCookies\r\n\r\nCookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device\'s internal memory.\r\n\r\nThis Service does not use these cookies explicitly. However, the app may use third-party code and libraries that use cookies to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.\r\n\r\nService Providers\r\n\r\nWe may employ third-party companies and individuals due to the following reasons:\r\n\r\nTo facilitate our Service;\r\nTo provide the Service on our behalf;\r\nTo perform Service-related services; or\r\nTo assist us in analyzing how our Service is used.\r\nWe want to inform users of this Service that these third parties have access to their Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.\r\n\r\nSecurity\r\n\r\nWe value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.\r\n\r\nLinks to Other Sites\r\n\r\nThis Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.\r\n\r\nChildrens Privacy\r\n\r\nThese Services do not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13 years of age. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do the necessary actions.\r\n\r\nChanges to This Privacy Policy\r\n\r\nWe may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page.\r\n\r\nThis policy is effective as of 2023-11-05\r\n\r\nContact Us\r\n\r\nIf you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us at support@cscodetech.com.', '1'),
(2, 'Terms & Conditions', 'Terms & Conditions\r\n\r\nBy downloading or using the app, these terms will automatically apply to you  you should make sure therefore that you read them carefully before using the app. Youre not allowed to copy or modify the app, any part of the app, or our trademarks in any way. Youre not allowed to attempt to extract the source code of the app, and you also shouldnt try to translate the app into other languages or make derivative versions. The app itself, and all the trademarks, copyright, database rights, and other intellectual property rights related to it, still belong to CSCODETECH.\r\n\r\nCSCODETECH is committed to ensuring that the app is as useful and efficient as possible. For that reason, we reserve the right to make changes to the app or to charge for its services, at any time and for any reason. We will never charge you for the app or its services without making it very clear to you exactly what youre paying for.\r\n\r\nThe Zigzagbus app stores and processes personal data that you have provided to us, to provide our Service. Its your responsibility to keep your phone and access to the app secure. We therefore recommend that you do not jailbreak or root your phone, which is the process of removing software restrictions and limitations imposed by the official operating system of your device. It could make your phone vulnerable to malware/viruses/malicious programs, compromise your phones security features and it could mean that the Zigzagbus app wont work properly or at all.\r\n\r\nThe app does use third-party services that declare their Terms and Conditions.\r\n\r\nLink to Terms and Conditions of third-party service providers used by the app\r\n\r\nYou should be aware that there are certain things that CSCODETECH will not take responsibility for. Certain functions of the app will require the app to have an active internet connection. The connection can be Wi-Fi or provided by your mobile network provider, but CSCODETECH cannot take responsibility for the app not working at full functionality if you dont have access to Wi-Fi, and you dont have any of your data allowance left.\r\n\r\nIf youre using the app outside of an area with Wi-Fi, you should remember that the terms of the agreement with your mobile network provider will still apply. As a result, you may be charged by your mobile provider for the cost of data for the duration of the connection while accessing the app, or other third-party charges. In using the app, youre accepting responsibility for any such charges, including roaming data charges if you use the app outside of your home territory (i.e. region or country) without turning off data roaming. If you are not the bill payer for the device on which youre using the app, please be aware that we assume that you have received permission from the bill payer for using the app.\r\n\r\nAlong the same lines, CSCODETECH cannot always take responsibility for the way you use the app i.e. You need to make sure that your device stays charged  if it runs out of battery and you cant turn it on to avail the Service, CSCODETECH cannot accept responsibility.\r\n\r\nWith respect to CSCODETECHs responsibility for your use of the app, when youre using the app, its important to bear in mind that although we endeavor to ensure that it is updated and correct at all times, we do rely on third parties to provide information to us so that we can make it available to you. CSCODETECH accepts no liability for any loss, direct or indirect, you experience as a result of relying wholly on this functionality of the app.\r\n\r\nAt some point, we may wish to update the app. The app is currently available on Android & iOS  the requirements for the both systems(and for any additional systems we decide to extend the availability of the app to) may change, and youll need to download the updates if you want to keep using the app. CSCODETECH does not promise that it will always update the app so that it is relevant to you and/or works with the Android & iOS version that you have installed on your device. However, you promise to always accept updates to the application when offered to you, We may also wish to stop providing the app, and may terminate use of it at any time without giving notice of termination to you. Unless we tell you otherwise, upon any termination, (a) the rights and licenses granted to you in these terms will end; (b) you must stop using the app, and (if needed) delete it from your device.\r\n\r\nChanges to This Terms and Conditions\r\n\r\nWe may update our Terms and Conditions from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Terms and Conditions on this page.\r\n\r\nThese terms and conditions are effective as of 2023-11-05\r\n\r\nContact Us\r\n\r\nIf you have any questions or suggestions about our Terms and Conditions, do not hesitate to contact us at support@cscodetech.com.', '1'),
(3, 'Contact Us', 'Well start with some questions and get you to the right place.\r\n\r\nlets get you some help. Were going to ask you some questions and then connect you with a member of our support team.\r\n\r\nCan you describe your issue in a few sentences? This will help our team understand whats going on.\r\n\r\nSkype: CSCODETECH\r\n\r\nFacebook: CSCODETECH\r\n\r\nWhatsApp: +91 7276465975', '1'),
